import React, { useState, useEffect, useRef } from "react";
import ProductCard from './sub_components/Card'
import ABCard from "./sub_components/adCard";

import NavBar from './sub_components/NavBar';
import Footer from './sub_components/Footer';
import TopItems from './sub_components/TopItems';

function HomePage() {
	const carousel = document.querySelector('.testimonial-carousel');
	const prevButton = carousel.querySelector('.carousel-prev');
	const nextButton = carousel.querySelector('.carousel-next');
	const container = carousel.querySelector('.carousel-container');

	let scroll = 0;

	prevButton.addEventListener('click', () => {
	scroll -= 200;
	container.scroll({
		left: scroll,
		behavior: 'smooth'
	});
	});

	nextButton.addEventListener('click', () => {
	scroll += 200;
	container.scroll({
		left: scroll,
		behavior: 'smooth'
	});
	});

	const [searchTerm, setSearchTerm] = useState('');
	const [products, setProducts] = useState([]);

	useEffect(() => {
		fetch('https://fakestoreapi.com/products?limit=6')
			.then(res => res.json())
			.then(products_array => {
				console.log(products_array);
				// [{
				// category, description, id, image, price, rating, title
				// }]
				// Get the first 10 products
				setProducts(products_array);
			});
	}, []);

	return (
		<div className="bodyTag">
			<NavBar />
			{/* <!-- Banner --> */}
			<div class="banner">
				<h1>Your Premium <br /> Sound, Unplugged!</h1>
				<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, <br />
					sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. </p>
				<button>Find out more</button>
			</div>
			{/* <!-- End of Banner --> */}


			<div className="productHeading">
				<h1>Our Premium	Collection</h1>
			</div>

			<div className="productCategories">
				<div class="productCat"><a href="#">All Products</a></div>
                <div class="productCat"><a href="#">Coats & Jackets</a></div>
                <div class="productCat"><a href="#">Dressed</a></div>
                <div class="productCat"><a href="#">Playsuit</a></div>
				<div class="productCat"><a href="#">Short</a></div>
				<div class="productCat"><a href="#">Skirt</a></div>
				<div class="productCat"><a href="#">T-Shirt</a></div>
			</div>
			{/* Product Collection */}
			<div className="products">
				
				{products.map(product => (
					<ABCard
						image={product.image}
						category={product.category}
						title={product.title}
						arrowButton={product.arrowButton}
					/>
				))}
			</div>
			<div className="productButton">
				<a href="#"><button>Find out more</button></a>
			</div>
			{/* End of Product Collection */}

			{/* <!-- Top Items --> */}
			<div className="topItemMainDiv">
				<div className="topItemText">
						<h1>Top Items</h1>
						<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod<br/>
						tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam.</p>
				</div>
				<TopItems
				products = {products}
				/>
			</div>

			{/* <!-- Story about our brand --> */}
			<div class="storyMain">
				<div class="story-container">
					<div class="image-container">
						<img src="bigimage.jpg" alt="Big Image" />
					</div>
					<div class="story">
						<h3>Story About Our Brand</h3>
						<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec quis ex sed odio accumsan finibus eu id velit. Sed ac consectetur enim. Sed iaculis, mauris id pulvinar pretium, lorem arcu tempus nisi, sed venenatis quam arcu auctor leo. Sed vitae lacinia neque.</p>
						<a href="#" class="read-more">Read More</a>
					</div>
				</div>
			</div>


			{/* <!--Our Achievement Div--> */}
			<div class="achievements">
				<h3>Our Achievements</h3>
				<div class="logos">
					<img src="logo1.png" alt="Logo 1" />
					<img src="logo2.png" alt="Logo 2" />
					<img src="logo3.png" alt="Logo 3" />
					<img src="logo4.png" alt="Logo 4" />
					<img src="logo5.png" alt="Logo 5" />
				</div>
			</div>
			{/* <!--End of Our Achievement Div--> */}

			{/* <!-- client section --> */}
			<div class="testimonial-carousel">
				<div class="carousel-container">
					<div class="testimonial-slide">
					<p>Testimonial 1</p>
					</div>
					<div class="testimonial-slide">
					<p>Testimonial 2</p>
					</div>
					<div class="testimonial-slide">
					<p>Testimonial 3</p>
					</div>
				</div>
				<button class="carousel-prev">&#8249;</button>
				<button class="carousel-next">&#8250;</button>
			</div>
			{/* <!-- end client section --> */}

			{/* <!-- News Letter Div --> */}
			<div class="newsContainer">
				<div class="newsletter">
					<h3>Join Our News Letters</h3>
					<p>Leverage agile frameworks to provide a robust synopsis for high level overviews. <br /> Iterative approaches to corporate strategy foster </p>
					<form>
						<div class="form-group">
							<input type="email" class="form-control" placeholder="Insert your mail here" />
							<button type="submit" class="btn btn-primary"><i class="fa fa-long-arrow-right"></i></button>
						</div>
					</form>
				</div>
			</div>

			<Footer />
		</div>
	);
}

export default HomePage;
